import { slide as Menu } from 'react-burger-menu';
import { useNavigate } from 'react-router-dom';
import React from 'react';

function Sidebar () {

    const navigate = useNavigate();
  
    return (
      <Menu>
        <button 
            className="menu-item" 
            onClick={(e)=>{navigate('/clientDashboard')}}>
            Home
        </button>
        <button 
            className="menu-item" 
            onClick={(e)=>{navigate('/clientSearchGoals')}}>
            Search Goals
        </button>
        <button 
            className="menu-item" 
            onClick={(e)=>{navigate('/clientVerify')}}>
            Verify
        </button>
        <button 
            className="menu-item" 
            onClick={(e)=>{navigate('/clientFeed')}}>
            Feed
        </button>
        <button 
            className="menu-item" 
            onClick={(e)=>{console.log(e)}}>
            Logout
        </button>
      </Menu>
    );
  };
  
  export default Sidebar;
